import { Container, MovieList, Movie } from "./style";


function Home(){

    const movies = [
        {
            title: 'Vaqueiro',
            image_url: 'https://nominuto.com/_assets/files/2016/03/Vaquejada3.jpg'

        },
        {
            title: 'Vaqueiro',
            image_url: 'https://nominuto.com/_assets/files/2016/03/Vaquejada3.jpg'
        },
        {
            title: 'Vaqueiro',
            image_url: 'https://nominuto.com/_assets/files/2016/03/Vaquejada3.jpg'
        },
    ]
    return(
        <Container>
            <h1>Movies</h1>
            <MovieList>
                {movies.map(movie => {
                    return(
                        <Movie>
                            <a href=""></a>
                            <span>{movie.title} Sofredor</span>
                        </Movie>
                    )
                })}
                <Movie>
                    <a href="" src="">   <img src="https://4.bp.blogspot.com/-ZC4_Gxufi5M/W32onh8i8YI/AAAAAAAAz3Q/qmdkEtI4kAUkxWOz095MPdz-Scnnq223wCK4BGAYYCw/s1600/Garanha%25CC%2583o%2BCalenda%25CC%2581rio%2BShady%2BAD_.Lanc%25CC%25A7amento_Ceara%25CC%2581_25.08.2018_foto%2BAnderson%2BCavalcanti_.jpeg"/></a>
                    <span>Cavalo de Vaquejada</span>
                </Movie>
                <Movie>
                    <a href="" src="">   <img src="https://4.bp.blogspot.com/-ZC4_Gxufi5M/W32onh8i8YI/AAAAAAAAz3Q/qmdkEtI4kAUkxWOz095MPdz-Scnnq223wCK4BGAYYCw/s1600/Garanha%25CC%2583o%2BCalenda%25CC%2581rio%2BShady%2BAD_.Lanc%25CC%25A7amento_Ceara%25CC%2581_25.08.2018_foto%2BAnderson%2BCavalcanti_.jpeg"/></a>
                    <span>Cavalo de Vaquejada</span>
                </Movie>
                <Movie>
                    <a href="" src="">   <img src="https://4.bp.blogspot.com/-ZC4_Gxufi5M/W32onh8i8YI/AAAAAAAAz3Q/qmdkEtI4kAUkxWOz095MPdz-Scnnq223wCK4BGAYYCw/s1600/Garanha%25CC%2583o%2BCalenda%25CC%2581rio%2BShady%2BAD_.Lanc%25CC%25A7amento_Ceara%25CC%2581_25.08.2018_foto%2BAnderson%2BCavalcanti_.jpeg"/></a>
                    <span>Cavalo de Vaquejada</span>
                </Movie>
            </MovieList>
        </Container>
    )

}



export default Home;
